import React from "react";

export default function MoneyBook() {
  return (
    <div className="h-screen w-screen bg-gradient-to-r from-green-100 to-white">
      <div className="flex  justify-end ">
        <div className="p-4 w-30 border-2">Add New Book</div>
      </div>
    </div>
  );
}
